function SummaryParty({ reference }) {
    return (
        <div className="bg-violet-200 mt-5 p-3 flex-col">
            <div>
                Name: {reference.name}
            </div>
            <div>
                {reference.name}
            </div>
        </div>
    );
}

export default SummaryParty;
